        pub enum ExtmarkPosition {
            /// Defines the extmark's position in the buffer by a 0-indexed `(row,
            /// col)` tuple.
            ByTuple((usize, usize)),

            /// Defines the extmark's position in the buffer by its id.
            ById(u32),
        }

