            #[inline]
            pub fn global_and_script_local_funcs<Line, Lines>(
                &mut self,
                lines: Lines,
            ) -> &mut Self
            where
                Lines: IntoIterator<Item = Line>,
                Line: Into<types::String>,
            {
                self.0.global_and_script_local_funcs =
                    lines.into_iter().map(Into::into).collect();
                self
            }
