            /// A `(line, column)` tuple describing where the the node is started.
            pub start: (usize, usize),

            /// Error message in printf format. Contains exactly one `"%.*s"` block.
            pub ty: VimLAstNode,
        }

        // fn deserialize_children<'de, D>(
