        #[non_exhaustive]
        #[derive(Clone, Debug, Eq, PartialEq, Hash, Serialize)]
        pub enum RegisterType {
            #[serde(serialize_with = "serialize_blockwise")]
            BlockwiseVisual(Option<usize>),

            #[serde(rename = "c")]
            Charwise,

            #[serde(rename = "l")]
            Linewise,

            #[serde(rename = "")]
            Guess,
        }
