            }
        }

        impl From<Option<char>> for WindowBorderChar {
            fn from(maybe: Option<char>) -> Self {
                Self::Char(maybe)
            }
        }

        impl<S: AsRef<str>> From<(char, S)> for WindowBorderChar {
            fn from((ch, hl): (char, S)) -> Self {
                Self::CharAndHlGroup(Some(ch), hl.as_ref().to_owned())
            }
